Seinfeld_episodes = [['The Stakeout', "Jerry and George stake out the lobby of an office building to find a woman Jerry met at a party but whose name and phone number he didn't get.", 'http://basementrejects.com/wp-content/uploads/2013/06/seinfeld-season-1-2-the-stake-out-george-costanza-jerry-seinfeld-vanessa-jason-alexander.jpg', 1, 1],['The Robbery', "After Jerry's apartment is robbed, Jerry starts to look for other apartments. But Jerry and George both want the same apartment, and Elaine wants the apartment of whomever loses out.", 'http://ilarge.listal.com/image/2381580/968full-seinfeld-screenshot.jpg', 1, 2],['Male Unbonding', 'Jerry tries various excuses to avoid meeting with an old friend with whom he no longer shares any interests.', 'http://www.fanaru.com/seinfeld/image/thumb/44215-seinfeld-male-unbonding-episode-screencap-1x4.jpg', 1, 3],['The Stock Tip', "Jerry becomes apprehensive when he and George buy stock and the price falls while the person who suggested the stock is in a coma and can't tell them when to sell.", 'http://basementrejects.com/wp-content/uploads/2013/06/seinfeld-season-1-5-the-stock-tip-jerry-seinfeld.jpg', 1, 4],['The Ex-Girlfriend', 'After George breaks up with his girlfriend, Jerry decides that he wants to see her.', 'http://basementrejects.com/wp-content/uploads/2013/09/seinfeld-season-2-1-the-ex-girlfriend-jerry-seinfeld-tracy-kolis-marlene.jpg', 2, 1],['The Pony Remark', "Jerry fears that an inappropriate comment he made at a dinner party caused his relative's subsequent death.", 'http://basementrejects.com/wp-content/uploads/2013/09/seinfeld-season-2-2-the-pony-remark-jerry-seinfeld-julia-louis-dreyfus.jpg', 2, 2],['The Busboy', 'George tries to apologize to a busboy after one of his comments got him fired, but he only makes things worse. Elaine tries to get one of her male friends out of her house.', 'http://www.fanaru.com/seinfeld/image/thumb/44228-seinfeld-the-busboy-episode-screencap-2x12.jpg', 2, 3],['The Baby Shower', 'Kramer convinces Jerry to get illegal cable. Elaine holds a baby shower for a former girlfriend of George, on whom he wants revenge for a callous incident.', 'http://www.fanaru.com/seinfeld/image/thumb/44226-seinfeld-the-baby-shower-episode-screencap-2x10.jpg', 2, 4],['The Jacket', "Jerry wears an expensive jacket when he meets Elaine's father, but an argument ensues when Jerry is reluctant to wear it outside during a snowfall.", 'http://basementrejects.com/wp-content/uploads/2013/09/seinfeld-season-2-11-the-chinese-restaurant-5-10-minutes-george-elaine-jerry-seinfeld-jason-alexander-julia-louis-dreyfus.jpg', 2, 5],['The Chinese Restaurant', 'Jerry, George and Elaine wait for a table at a Chinese restaurant.', 'http://basementrejects.com/wp-content/uploads/2013/09/seinfeld-season-2-11-the-chinese-restaurant-5-10-minutes-george-elaine-jerry-seinfeld-jason-alexander-julia-louis-dreyfus.jpg', 2, 6],['The Phone Message', "George leaves several awkward messages on a girlfriend's answering machine, then decides to steal the tape.", 'https://lh5.googleusercontent.com/-y1WXc2nW4mM/TzQN48INO7I/AAAAAAAAAyY/8PUDwzgeCwE/w800-h800/Screen%2Bshot%2B2012-02-09%2Bat%2B8.10.29%2BAM.png', 2, 7],['The Apartment', "When an apartment becomes available in Jerry's building, he helps Elaine get it, only to regret his decision to do so. George starts wearing a wedding ring because he's heard that it helps single guys pick up women.", 'http://4.bp.blogspot.com/-UPhRSfKp6Y4/T343mDuMNCI/AAAAAAAABJI/khrOnCPtT9c/s1600/Seinfeld+VHS.jpg', 2, 8],['The Statue', "A statue wanted by George is stolen from Jerry's apartment by the boyfriend of a writer Elaine is working with.", 'http://www.fanaru.com/seinfeld/image/44222-seinfeld-the-statue-episode-screencap-2x6.jpg', 2, 9],['The Heart Attack', 'George thinks he suffered a heart attack, only to discover inflamed tonsils instead, and seeks alternative medicine to help him.', 'http://kingofthrones.files.wordpress.com/2013/04/screen-shot-2013-04-21-at-9-38-52-pm.png', 2, 10],['The Revenge', 'George takes revenge on his boss for not hiring him back after he quit and being rude to him, and Jerry and Kramer take revenge on a dry cleaner after Jerry accuses him of stealing $1,500 from his laundry bag.', 'https://yuq.me/tv/screencaps/02/942/150628.jpg', 2, 11],['The Deal', 'Jerry and Elaine believe that they have found a fool-proof way to start having sex again but still remain just friends, but they quickly start encountering problems.', 'http://iv1.lisimg.com/image/434013/600full-seinfeld-screenshot.jpg', 2, 12],['The Note', 'Jerry and George get their dentist in trouble while trying to get free massages. George feels uncomfortable getting a massage from a man. Kramer sees Joe DiMaggio in a donut shop.', 'https://lh3.ggpht.com/B-c6HjM94T9DRqK9iu_nm1ehedV3ibsDkTSR_In5CsrwPlT7L1SDl6AoxT9q4QfBZg=h900', 3, 1],['The Truth', 'A bad breakup between George and his girlfriend leads to tax troubles for Jerry.', 'http://www.gossipcop.com/wp-content/uploads/2014/01/Screen-Shot-2014-01-30-at-3.45.38-PM.png', 3, 2],['The Pen', 'Jerry and Elaine travel to Florida for a dinner in honor of his father. Jerry gets into an argument with a neighbor of his parents over an "astronaut pen."', 'http://i.ytimg.com/vi/ODO0zQBPI2k/maxresdefault.jpg', 3, 3],['The Dog', 'Jerry is forced to care for the disobedient dog of a man he met on a plane.', 'http://i500.listal.com/image/3013989/500full.jpg', 3, 4],['The Library', "The fate of people from Jerry's and George's past is revealed as Jerry is forced to account for an overdue book from 1971. Kramer falls for a librarian. Elaine fears trouble at work.", 'http://3.bp.blogspot.com/_XmJC-ou7t6I/TS8tWyTO1QI/AAAAAAAAAZ8/UxnPFdOYzAs/s1600/seinfeld.jpg', 3, 5],['The Parking Garage', 'The four get stuck in a parking garage for hours when they forget where they parked.', 'http://basementrejects.com/wp-content/uploads/2014/04/seinfeld-season-3-6-the-parking-garage-lost-car-jerry-elaine-benes-george-costanza-kramer-jason-alexander-michael-richards-julia-louis-dreyfus-review-episode-guide-list.jpg', 3, 6],['The Cafe', 'Jerry tries to help a new immigrant restaurant owner across the street from him. George, afraid of embarrassment, asks Elaine to take an IQ test for him.', 'http://sprudge.com/wp-content/uploads/2014/01/Screen-Shot-2014-01-16-at-2.10.03-PM.png', 3, 7],['The Tape', 'George orders hair growing cream from China. Jerry is mesmerized by a dirty message left on a tape recorder from his last performance. George becomes infatuated with Elaine.', 'http://www.fanaru.com/seinfeld/image/thumb/44238-seinfeld-the-alternate-side-episode-screencap-3x11.jpg', 3, 8],['The Nose Job', 'Jerry dates a vacuous actress and struggles with overcoming his sexual desire for her. George dates a woman with a large nose, who decides to get a nose job after a careless comment from Kramer.', 'http://www.fanaru.com/seinfeld/image/44237-seinfeld-the-nose-job-episode-screencap-3x9.jpg', 3, 9],['The Stranded', 'Jerry and Elaine are stranded at a party in Long Island waiting for Kramer after George leaves with a woman from his office. George has an argument with a cashier over change.', 'http://1.bp.blogspot.com/-1zDVBOows_0/UaZAYBY3jqI/AAAAAAAAEeM/4iR8-n2CQI4/s1600/209-stranded.png', 3, 10],['The Alternate Side', "Jerry's car is stolen. Elaine dates an older man. Kramer gets a small role in a Woody Allen movie filmed on his and Jerry's block. George must deal with the commotion of the movie filming as he gets a job parking cars on the block.", 'http://www.fanaru.com/seinfeld/image/thumb/44238-seinfeld-the-alternate-side-episode-screencap-3x11.jpg', 3, 11],['The Red Dot', "George gets a job at Elaine's office and gets involved with the cleaning woman. Elaine's boyfriend is a recovering alcoholic who falls off the wagon because of Jerry's carelessness. George buys Elaine a marked-down cashmere sweater.", 'http://www.fanaru.com/seinfeld/image/thumb/44239-seinfeld-the-red-dot-episode-screencap-3x12.jpg', 3, 12],['The Subway', "Jerry, George, Kramer, and Elaine leave the comfort of Jerry's building and take to the New York subway. But comedy abruptly ensues as our characters embark on their individual adventures.", 'https://adsonthesubway.files.wordpress.com/2014/05/screen-shot-2014-05-23-at-11-49-06-am.png', 3, 13],['The Pez Dispenser', 'In this episode, Kramer joins the Polar Bears and Jerry obsesses over a hard to load Pez Dispenser. While George struggles to get "hand" from his pianist girlfriend whose concert is ruined due to Elaine\'s, "Pez induced laughter."', 'http://www.fanaru.com/seinfeld/image/thumb/44241-seinfeld-the-pez-dispenser-episode-screencap-3x14.jpg', 3, 14],['The Suicide', "After a suicide attempt by Jerry's neighbor lands him in a coma, Jerry begins a relationship with his girlfriend. George visits a psychic who predicts trouble on his upcoming trip. Elaine agonizes over having to fast before surgery.", 'http://plasmapool.org/wp-content/uploads/2011/02/Screen-shot-2011-02-06-at-12.19.40-PM-1024x767.png', 3, 15],['The Fix Up', 'Jerry and Elaine fix George up with a friend of hers.', 'http://www.fanaru.com/seinfeld/image/thumb/44243-seinfeld-the-fix-up-episode-screencap-3x16.jpg', 3, 16],['The Boyfriend: Part 1', 'In the first hour-long episode, Jerry hooks up with Keith Hernandez at the gym. He tries to meet with Keith only to be shunned because Keith is infatuated with Elaine. George tries to keep his unemployment money coming in when he tells the unemployment officer that he got a job with "Vandelay Industries", a company that manufactures latex. Kramer and Newman recall an incident in which Keith spit on them after a really bad Mets game. The details of the incident strangely mirror that of the JFK assassination.', 'http://basementrejects.com/wp-content/uploads/2014/04/seinfeld-season-3-18-the-boyfriend-part-2-elaine-benes-dates-keith-hernandez-julia-louis-dreyfus-review-episode-guide-list.jpg', 3, 17],['The Boyfriend: Part 2', 'Jerry becomes increasingly jealous of Elaine\'s relationship with Keith Hernandez. The unemployed George Constanza schemes to collect unemployment checks, while the illustrated JFK "second spitter theory" is further investigated.', 'http://basementrejects.com/wp-content/uploads/2014/04/seinfeld-season-3-18-the-boyfriend-part-2-elaine-benes-dates-keith-hernandez-julia-louis-dreyfus-review-episode-guide-list.jpg', 3, 18],['The Limo', "George meets Jerry at the airport as scheduled but his car broke down on the way there and now don't have a way to get back. When Jerry notices a limo driver waiting for someone named O'Brien, he knows the passenger will never show up since he was supposed to be on Jerry's flight but refused boarding. George has a solution to their problem - just tell the driver he's O'Brien and they'll get a free ride into Manhattan. When the driver tells them he's taking them to Madison Square Garden, they assume they're going to see a Knicks-Bulls game. They're joined by an ...", 'https://lh5.googleusercontent.com/-d-Md97blzUc/T_OKwilHkfI/AAAAAAAACI0/rIOPT6P9f-Q/w800-h800/Screen%2Bshot%2B2012-07-03%2Bat%2B2.11.57%2BPM.png', 3, 19],['The Good Samaritan', "Jerry trails a hit-and-run driver but is attracted to her and begins dating her; he later learns her victim was a longtime quarry and dates the latter as well. Kramer begins having seizures whenever he hears Mary Hart's voice.", 'http://www.fanaru.com/seinfeld/image/thumb/44247-seinfeld-the-good-samaritan-episode-screencap-3x20.jpg', 3, 20],['The Letter', 'Jerry learns that his new artist friend, from whom George has been forced to buy a painting, plagiarized a letter to keep him from breaking up with her. Elaine refuses to remove her Baltimore Orioles cap during a New York Yankees game.', 'http://cdn.thewire.com/media/img/upload/wire/2014/02/02/Screen_Shot_2014_02_02_at_8.37.44_PM/lead_large.png', 3, 21],['The Parking Space', "Coming from an outing to a flea market in New Jersey, Elaine and George damage Jerry's car when George drives over a large pothole. When they get to his apartment they conveniently find a parking space right in front of Jerry's building. As George tries to back in however, someone tries to take the spot by driving in nose first. With neither car able to park, it leads to an all day argument. Elaine meanwhile has to come with a story about the damage to the car.", 'http://basementrejects.com/wp-content/uploads/2014/04/seinfeld-season-3-22-the-parking-space-george-costanza-vs-mike-parallel-parking-pull-in-back-in-jason-alexander-lee-arenberg-review-episode-guide-list.jpg', 3, 22],['The Keys', "Jerry is fed up with Kramer coming into his apartment any time he feels like it and asks him to return his spare set of keys. Kramer begrudgingly complies but then lets it be known that he's leaving for California. As for the others, the one key swap leads to multiple exchanges on pretty well everyone's part. When Jerry forgets his keys, he gets George to let him into Elaine's apartment so her can get his spare set. What they find interests them.", 'http://www.fanaru.com/seinfeld/image/thumb/44238-seinfeld-the-alternate-side-episode-screencap-3x11.jpg', 3, 23],['The Trip: Part 1', 'When Jerry is asked to appear on The Tonight Show in Los Angeles, George accompanies him to look for Kramer.', 'http://img.crazyhdsource.com/wp-content/cover/files/Seinfeld.S09E24.720pL4.1.MAGiC.jpeg', 4, 1],['The Trip: Part 2', 'Kramer is arrested when he is mistaken for a serial killer. After he is exonerated, Jerry, George, and he return to New York.', 'http://www.iamnotastalker.com/wp-content/uploads/2012/03/ScreenShot3832.jpg', 4, 2],['The Pitch', 'NBC executives ask Jerry to come up with an idea for a TV series. George decides he can be a sitcom writer and comes up with "nothing." Kramer trades a radar detector for a helmet, and later Newman receives a speeding ticket.', 'http://www.rspmarketing.com/wp-content/uploads/2013/05/Screen-Shot-2013-05-01-at-2.26.30-PM1.png', 4, 3],['The Ticket', 'Newman uses Kramer as his witness when the former refuses to pay for a speeding ticket.', 'http://cdn.phillymag.com/wp-content/uploads/2014/11/Screen-shot-2014-11-07-at-11.12.37-AM-e1415376893736.png', 4, 4],['The Wallet', "Jerry is asked to explain to his parents why he does not wear the watch they gave him. Morty Seinfeld thinks his wallet to have been stolen from him at his doctor's appointment.", 'http://www.fanaru.com/seinfeld/image/thumb/44255-seinfeld-the-wallet-episode-screencap-4x5.jpg', 4, 5],['The Watch', "Jerry tries to buy his watch back from Uncle Leo, who found it in the garbage, having been thrown there by Jerry. George tries to resurrect the fledgling NBC deal, while Elaine plans a break up from her psychotherapist with Kramer's help.", 'http://watchesinmovies.info/img/f/Seinfeld_Breitling.jpg', 4, 6],['The Bubble Boy', "George and Susan invite Jerry, his girlfriend Naomi, Elaine and Kramer to spend the weekend at her parents' cabin upstate. Naomi bows out after Jerry makes a comment on her laugh and Kramer isn't interested. After Elaine goads him into it, Jerry agrees to stop off on the way and visit a fan who lives in a plastic bubble enclosed room due to an autoimmune disease. They go in separate cars and George drives so fast that Jerry and Elaine lose them and not having the boy's address end up in a diner. Kramer and Naomi meanwhile decide to go to the cabin with unfortunate ...", 'http://img.youtube.com/vi/_SULQSL4Cd0/0.jpg', 4, 7],['The Cheever Letters', "Jerry offends Elaine's assistant. Kramer makes a contact for Cuban cigars. A box of letters from John Cheever is all that remains after Susan's father's cabin burns down.", 'http://i.onionstatic.com/avclub/3564/31/16x9/960.jpg', 4, 8],['The Opera', "Elaine unknowingly is dating Crazy Joe Davola, who has just left a threatening message on Jerry's recorder.", 'http://img4.appstatic.opera.com/prodimg/26505_screenshot_8.png', 4, 9],['The Virgin', "Not having come up for a script for their new sitcom, George and Jerry now have to face the music when they meet with NBC executives. George's lack of discretion however has repercussions. Jerry see Marla Penny in a bar and mentions to George that when he last saw her, she was a virgin. Jerry asks her out and finds out she still is. Elaine, on hearing the news, decides to give her a bit of coaching about men and what she can expect.", 'http://wac.9ebf.edgecastcdn.net/809EBF/ec-origin.nyc.barstoolsports.com/files/2013/04/Screen-Shot-2013-04-30-at-3.03.23-PM.png', 4, 10],['The Contest', "After George's mother catches him alone in a somewhat embarrassing situation, Jerry, George, Elaine and Kramer stage a contest to see who can last the longest without any sexual gratification. Temptation quickly sets in for everyone. Kramer is the first to fall after ogling the woman across the street who walks around her apartment naked. George is next after he visits his mother in hospital and her roommate gets a sponge bath across from the curtain separating them. Elaine signs up for a fitness class where none other than JFK Jr. is enrolled. Her fantasizing does ...", 'http://cdn8.staztic.com/app/a/2028/2028336/seinfeld-free-live-wallpaper-925274-2-s-307x512.jpg', 4, 11],['The Airport', 'Jerry and Elaine are on their way back to New York but learn their original flight has been canceled. As a result, Jerry ends up in first class and Elaine in coach. While Jerry has a wonderful flight with food, champagne and a beautiful blond models as a seat mate, Elaine suffers through the flight from hell. Back in New York, George and Kramer are supposed to meet Jerry and Elaine but the change in flight - and then a change in airport - has them running all over the place. More mayhem ensues when Kramer thinks he recognizes someone from his past.', 'http://mentalfloss.com/sites/default/files/styles/article_640x430/public/screen_shot_2013-02-08_at_2.49.33_pm.png', 4, 12],['The Pick', "George has decided he's made a terrible mistake in breaking up with Susan. He moans and groans and is generally driving everybody crazy. Against everyone's advice he decides to tell her he made a mistake . No sooner are they back together than he decides he's the one who made the mistake. Elaine decides to put her picture on her Christmas cards and Kramer agrees to be the photographer. Only problem is that she exposes just a little too much of herself. Jerry meanwhile is dating the model he recently met on a flight and things seem to be going nicely....until she sees ...", 'https://lh3.ggpht.com/B-c6HjM94T9DRqK9iu_nm1ehedV3ibsDkTSR_In5CsrwPlT7L1SDl6AoxT9q4QfBZg=h900', 4, 13],['The Movie', 'Jerry does a set at a comedy club, then goes to meet George, Elaine, and Kramer afterward to see a screening of Checkmate. However, a simple miscommunication causes the four to keep missing each other at two different theaters.', 'https://lh3.ggpht.com/B-c6HjM94T9DRqK9iu_nm1ehedV3ibsDkTSR_In5CsrwPlT7L1SDl6AoxT9q4QfBZg=h900', 4, 14],['The Visa', "Jerry returns from a two week tour to find that his old friend Babu, who Jerry drove into bankruptcy by suggesting he change the menu in his restaurant, is working at the caf\xc3\xa9. He's also living down the hall from Jerry who is shocked to find that Babu is arrested for overstaying his visa. Turns out his visa application got mixed in with Jerry's mail. George meanwhile asks an attractive lawyer, Cheryl, to go out with him. She laughs at everything he says and he tells Jerry to butt out and not be funny. When they hear that Cheryl does immigration law, they ask her to ...", 'http://2.bp.blogspot.com/_tlmFooqySI8/RrFisrXUdLI/AAAAAAAAAoo/qwvSR9VgwOA/s400/AaronCook.com_Babu_Bhatt_Seinfeld.bmp', 4, 15],['The Shoes', "Elaine cant seem to figure out why her shoes are a subject of conversation. Jerry and George pitch their pilot to NBC, but the deal is nearly jinxed when George takes a peak at the cleavage of the NBC president's daughter.", 'http://images.wikia.com/seinfeld/images/e/e9/The_shoes.jpg', 4, 16],['The Outing', "A woman is eavesdropping on the conversation that Elaine has with Jerry and George at the coffee shop. Elaine decides to give the woman the impression that Jerry and George are a homosexual couple. Unfortunately that woman is a reporter from NYU who is doing an interview with Jerry for the school newspaper. She goes to Jerry's apartment and the suspicions are confirmed when Jerry and George get in a fight over a piece of fruit. She publishes an article using the angle that Jerry and George are a homosexual couple. Things get even worse when Jerry's birthday gifts ...", 'http://3.bp.blogspot.com/-4NiqCSqGZNQ/U-1Mrz2WCfI/AAAAAAAAMoQ/_G0mOXckew8/s1600/Screen_Shot_2013-06-07_at_12.33.20_PM.png', 4, 17],['The Old Man', "Elaine gets the gang to volunteer at an old folks' home. She gets freaked out by hers, George gets fired by his guy, and Jerry loses his. Kramer and Newman scheme to sell records to a vintage music store and steal the records from Jerry's old guy.", 'http://uproxx.files.wordpress.com/2013/09/screen-shot-2013-09-19-at-2-44-22-pm.png?w=650', 4, 18],['The Implant', 'Jerry insists that his new girlfriend has implants. But she keeps insisting that they\'re "real and spectacular". The mystery goes even deeper when Elaine meets her in the sauna and trips and lands on her breasts.', 'https://lh3.googleusercontent.com/-ypA0CT72PRM/UBnIs6ter6I/AAAAAAAACvQ/yqhn4luO94k/w800-h800/Screen%2Bshot%2B2012-08-01%2Bat%2B7.24.58%2BAM.png', 4, 19],['The Junior Mint', "Elaine's ex-boyfriend is recovering in the hospital and has surgery. The gang goes to visit. Kramer gets the idea to paint his apartment to simulate the feel of a ski lodge. While at the hospital, Kramer's concern about the operation gets him and Jerry in to watch. But when Kramer sneaks in candy and forces it on Jerry, Jerry starts a chain reaction that causes the Junior Mints to land in Elaine's ex-boyfriend. Jerry thinks he may have killed the guy while George, who learns that he has recently come into some money, decides to invest in the ex-boyfriend's artwork.", 'http://insuranceentertainment.com/wp-content/uploads/2014/07/Screen-Shot-2014-07-06-at-9.52.23-AM.png', 4, 20],['The Smelly Car', "After dinner, Jerry gets his car back from the valet. He and Elaine get in the car and realize that the valet has really bad B.O.. Jerry goes to great lengths to get the smell out of his car while Elaine goes to great lengths to get the smell out of her hair. Jerry soon realizes that the smell isn't just a mere odor, but an entity unto itself, and finally decides that he has to get rid of his car. Meanwhile, George gets reacquainted with Susan and discovers that he drove her to lesbianism, and Kramer dates Susan's girlfriend.", 'http://www.criticalcommons.org/Members/Ghent/clips/the%20smelly%20car.mp4/thumbnailImage', 4, 21],['The Handicap Spot', "At Kramer's insistence, George parks his Dad's car in a handicap spot. After a woman is injured because of it, George becomes his Dad's butler while Kramer tries to help the woman.", 'http://legendsrevealed.com/entertainment/wp-content/uploads/2009/07/seinfeld_episode062_337x233_040420061510.jpg', 4, 22],['The Pilot', 'In the fourth season finale, Jerry and George\'s pilot is finally a go. But before the taping, Elaine desperately tries to avoid NBC president Russell Dalrymple after an awkward date, while Kramer comes face to face with his TV show counterpart. Before the pilot airs, Crazy Joe Davola (see episode "The Opera") shows up to put a damper in the gang\'s plans. As the pilot is finally finished and ready for airtime, the executives at NBC aren\'t impressed with the result.', 'http://img267.imageshack.us/img267/8916/snapshot00002i.jpg', 4, 23],['The Mango', 'Jerry gets a shocking revelation when Elaine reveals that she faked every orgasm while they were dating. Jerry then pleads with Elaine to get a second chance in bed. Meanwhile, Kramer turns George onto the erotic pleasures of fruit, specifically the mango.', 'http://avocado.feedyourskull.com/wp-content/uploads/2013/02/300x227xSeinfeld-The-Mango-Screen-Shot-300x227.png.pagespeed.ic._moH1-g_bR.jpg', 5, 1],['The Puffy Shirt', 'Kramer and his soft-spoken friend Leslie start a new line of clothing and Jerry accidentally agrees to wear it on the Today show.', 'http://www.themost10.com/wp-content/uploads/2012/04/The-Puffy-Shirt-Seinfeld.jpg?354d8b', 5, 2],['The Glasses', 'George loses his glasses at the health club, but his plans to get a new pair using Kramer\'s "discount" backfires. Meanwhile, Jerry buys a black-market air conditioner - the Commando 8, and Elaine gets bit by a dog at the optometrist\'s office.', 'http://4.bp.blogspot.com/-UPhRSfKp6Y4/T343mDuMNCI/AAAAAAAABJI/khrOnCPtT9c/s1600/Seinfeld+VHS.jpg', 5, 3],['The Sniffing Accountant', "Jerry, Kramer and Newman have reason to suspect that their accountant, Barry Profit, is taking their money and using it to buy illegal narcotics. The three organize a stakeout to confirm their suspicions, while Elaine, who had a past relationship with Barry, denies it. George gets an interview at a company that manufactures women's underwear.", 'https://lh3.googleusercontent.com/-f2USttfEWoY/T4htrQ9t2fI/AAAAAAAABYc/hgYOeLj17Ek/w800-h800/Screen%2Bshot%2B2012-04-13%2Bat%2B8.15.40%2BAM.png', 5, 4],['The Bris', "Jerry and Elaine get asked to be the godparents for their friend's newborn baby. But unfortunately the position doesn't last very long when Elaine hires a drunken rabbi to perform the Bris. While at the hospital, Kramer thinks he found a pig-man while a mental patient jumps to his death and lands on George's car.", 'http://www.fanaru.com/seinfeld/image/44279-seinfeld-the-bris-episode-screencap-5x5.jpg', 5, 5],['The Lip Reader', "George decides to use Jerry's girlfriend to spy on his friends by having her read their lips. Kramer claims he can also read lips and tries to prove it.", 'http://www.fanaru.com/seinfeld/image/thumb/44280-seinfeld-the-lip-reader-episode-screencap-5x6.jpg', 5, 6],['The Non-Fat Yogurt', "Kramer invests in a new new non-fat yogurt store, which becomes a hit in the city. Jerry and Elaine discover that they've been gaining weight and wonder if the yogurt really is non fat or not. Jerry tries to unravel this mystery while also dealing with a neighbor's kid who saw his act and the one rare instance where Jerry unleashes profanities on stage. Meanwhile, George runs into a former childhood acquaintance, Lloyd Braun, who is working on the mayoral campaign for incumbent Mayor Dinkins, but the campaign is quickly jeopardized when Elaine proposes a name tag ...", 'http://www.fanaru.com/seinfeld/image/thumb/44281-seinfeld-the-non-fat-yogurt-episode-screencap-5x7.jpg', 5, 7],['The Barber', 'Jerry regrets giving his longtime barber the heave-ho after he gets a ridiculous-looking haircut. George gets a job interview but the boss leaves him with a very cryptic ending. Kramer begs Elaine to let him take part in her charity bachelor auction.', 'http://www.fanaru.com/seinfeld/image/thumb/44282-seinfeld-the-barber-episode-screencap-5x8.jpg', 5, 8],['The Masseuse', "Jerry gets mad when he dates a masseuse. Kramer and George get massages while Jerry doesn't. Meanwhile, Elaine's new boyfriend is Joel Rifkin, an innocent man who shares the same name as one of New York's most notorious serial killers.", 'http://s1.ibtimes.com/sites/www.ibtimes.com/files/styles/v2_article_large/public/2014/07/03/lisa-edelstein.png?itok=yqFIWS5F', 5, 9],['The Cigar Store Indian', "Jerry is deemed a racist when he purchases a Native American statue for Elaine. Kramer tries to get Elaine's company to publish his coffee table book. Elaine runs into a really creepy man on the subway who steals Frank's TV Guide and follows her to the Costanza's house. Meanwhile, George gets grounded when he has sex with a woman in his parents' bed.", 'http://plasmapool.org/wp-content/uploads/2010/12/Screen-shot-2010-12-23-at-9.22.03-AM.png', 5, 10],['The Conversion', "George decides to convert to Latvian Orthodox to impress a girl, against his angry parents' objections. Meanwhile, Kramer converts a nun at the church, and Jerry takes a peek in his girlfriend's medicine cabinet and is stunned by what he finds.", 'http://www.blogcdn.com/www.engadget.com/media/2008/09/seinfeld16x9ne0.jpg', 5, 11],['The Stall', 'At a movie theater\'s restroom, Elaine, realizing she doesn\'t have any toilet paper left, asks the woman in the next stall (Jami Gertz) if she has any toilet paper to spare, but the woman refuses, claiming that she "can\'t spare a square". Elaine pleads with the woman, but she leaves, ignoring Elaine. The woman returns to her seat, and is revealed as Jerry\'s girlfriend, Jane. Elaine is shown returning to her seat, with her new boyfriend Tony (played by Dan Cortese). The two women tell their dates about what had just happened. At Jerry\'s apartment, Kramer walks in, ...', 'https://lh4.googleusercontent.com/-_7XPABcG3BQ/T_zDHaH--MI/AAAAAAAACPo/2AWfNP4ng5k/w800-h800/Screen%2Bshot%2B2012-07-10%2Bat%2B10.03.09%2BAM.png', 5, 12],['The Dinner Party', 'En route to a dinner party, Jerry and Elaine stop off at a bakery and get held up when the bakery runs out of what they want to purchase. Meanwhile, George and Kramer, en route to said dinner party, stop off at a liquor store to buy a bottle of wine and have a hard time picking one out.', 'http://www.fanaru.com/seinfeld/image/thumb/44287-seinfeld-the-dinner-party-episode-screencap-5x13.jpg', 5, 13],['The Marine Biologist', "George starts dating a woman who (told by Jerry) thinks George is a marine biologist. Elaine's electronic organizer injures a person after being launched from a limo by a Russian novelist. Kramer decides to golf on the beach.", 'http://media1.break.com/breakstudios/2012/1/5/george-costanza.jpg', 5, 14],['The Pie', "While shopping for a new suit for a job interview, George and the others stumble upon a mannequin which scarily resembles Elaine. Meanwhile Jerry tries to figure out why his girlfriend won't try his apple pie at Monks.", 'http://i467.photobucket.com/albums/rr36/altreel/Top%20Ten/Worst%20Seinfeld%20Episodes/thepie.png', 5, 15],['The Stand-In', 'Kramer gets a job with Micky as a TV stand-in. Jerry sets Elaine up with a guy who he says would be perfect for her. At the end of their first date he takes "it" out.', 'http://static.squarespace.com/static/51b3dc8ee4b051b96ceb10de/t/5304e165e4b0f73a9b7b0884/1392828775685/Screen%20Shot%202014-02-19%20at%208.52.29%20AM.png', 5, 16],['The Wife', "Jerry gets a permanent discount at his local dry cleaners after returning a locket he found in a jacket pocket. His new girlfriend Meryl also claims the discount claiming to be Jerry's wife. It all gets out of hand when Jerry's Uncle Leo hears he's married. Elaine thinks an airline pilot who goes to the same health club but her interest wanes quickly when he wipes the top of her water bottle before drinking from it. George is in trouble when the pilot sees him urinating in the shower at the same club. Kramer has had trouble sleeping at home but not, unfortunately at ...", 'http://cdn8.staztic.com/app/a/2028/2028336/seinfeld-free-live-wallpaper-925274-2-s-307x512.jpg', 5, 17],['The Raincoats', 'In this two-part episode, Jerry\'s parents are visiting before leaving for France. Jerry has a hard time connecting with his new girlfriend Rachel because his parents are spending so much time in his apartment. George uses the trip to get out of volunteering for the Big Brother program, but is stunned to learn that his Little Brother is searching for his dad in France. Kramer and Morty team up to sell Morty\'s old belt-less trench coat "The Executive" to a vintage clothing store. Elaine\'s creepy new boyfriend is a "close talker" who enjoys spending time with Jerry\'s ...', 'http://www.fanaru.com/seinfeld/image/thumb/44293-seinfeld-the-raincoats-2-episode-screencap-5x19.jpg', 5, 18],['The Fire', 'George dates a woman who has a son. She invites him to her son\'s birthday party. While at the party, a fire breaks out in the kitchen. George screams "FIRE!!!" and knocks down the kids and the old lady as he cowardly tries to make his escape. The clown (not Bozo) puts out the fire with his big shoe. Meanwhile, over at Pendant Publishing, Elaine learns that she\'s up for a very nice promotion. But her main competition, Toby, is working with Kramer on his coffee table book. The three head over to the comedy club where Jerry is doing an important set where a writer from ...', 'http://edgecast.metatube-files.buscafs.com/uploads/videos/image/image_147623_6.jpg', 5, 19],['The Hamptons', "Elaine, Jerry, George and Kramer visit friends in the Hamptons who've just had a baby. They're there for the weekend and George's new girlfriend Jane is there with him, even though they've never slept together. Jerry 's old girlfriend Rachel is there as well but trouble erupts when Rachel sees George naked and then giggles. Elaine takes an interest in the baby's pediatrician but isn't sure the compliment he paid her is necessarily a compliment. Kramer gets lobsters from a trap in the ocean not realizing that they belong to a professional fisherman.", 'https://lh6.googleusercontent.com/-_1pCKq6sPp0/T9jQejebC7I/AAAAAAAAB9g/Dzq6bqyDcTw/w800-h800/Screen%2Bshot%2B2012-06-13%2Bat%2B6.57.49%2BAM.png', 5, 20],['The Opposite', "A simple pick up line in the coffee shop proves Jerry's theory that every instinct George has is wrong. George decides to try the opposite, and that lands him an attractive girlfriend, a job offer with the New York Yankees, and an apartment that allows him to finally move out of his parent's house. Simultaneously, Elaine's mistake of stopping off for candy after learning her boyfriend was hospitalized causes her fortune to take a downturn. She gets kicked out of her apartment, breaks up with her boyfriend, and the candy causes a chain reaction that ultimately leads to...", 'http://thoughtcatalog.files.wordpress.com/2014/06/screen-shot-2014-06-03-at-10-12-48-am.png?w=584&h=457', 5, 21],['The Chaperone', "Jerry connects with a Miss America pageant contestant, Miss Rhode Island, at a Yankees game and asks her out on a date. They have to have a chaperone however and and Kramer volunteers. It turns out Kramer knows a lot about how to win a beauty pageant and is soon Miss Rhode Island's personal trainer. After being turned down for a job at a major book publisher, Elaine is hired by Justin Pitt as his personal assistant. Her first task is to go out and buy him new socks. George meanwhile is surprised to learn that the Yankees uniforms are made of polyester and switches ...", 'http://img2.wikia.nocookie.net/__cb20120907233900/seinfeld/images/b/b5/The_chaperone.jpg', 6, 1],['The Big Salad', "Kramer thinks that a simple penalty stroke may have driven his golf partner, Steve Gennison, to murder a dry cleaner. Jerry is stunned to learn that his girlfriend not only went out with, but was dumped by Newman. George thinks Elaine gave his girlfriend an incorrect thank you when it was actually George who paid for Elaine's lunch. Elaine flirts with a stationary store employee and thinks that she may have sent him the wrong message.", 'http://img3.wikia.nocookie.net/__cb20120907235620/seinfeld/images/4/47/The_big_salad.jpg', 6, 2],['The Pledge Drive', "Kramer finds Jerry's old birthday checks from his grandmother and insists he deposits them, which puts Nana in unexpected debt. Elaine accidentally tells the high talker a secret. Mr Pitt eats a Snickers bar with utensils.", 'http://insuranceentertainment.com/wp-content/uploads/2014/07/Screen-Shot-2014-07-06-at-9.58.11-AM.png', 6, 3],['The Chinese Woman', "George's telephone line crosses with that of a woman named Donna Chang, and everyone seeks her advice when she convinces them that she's Chinese. Jerry winds up dating her. Things get worse when Frank and Estelle announce a separation. Jerry and Elaine can't seem to figure out why Frank Costanza is having mysterious business dealings with a man in a cape.", 'http://thoughtcatalog.files.wordpress.com/2013/10/screen-shot-2013-10-18-at-9-02-34-pm.png?w=584&h=578', 6, 4],['The Couch', 'Elaine dates a moving guy, and things are going well for her until Jerry wants to know what his opinion on abortion is. Poppy returns and he and Kramer are going into business together to create a restaurant where you make your own pizza. Meanwhile, George goes out of his way to cheat on a book club test by renting "Breakfast At Tiffany\'s" instead of reading the book.', 'http://the-gaggle.com/wp-content/uploads/2013/03/Screen-Shot-2013-03-18-at-11.47.25-PM.png', 6, 5],['The Gymnast', "George's girlfriend's mom thinks he is a bum when she catches George eating an \xc3\xa9clair out of the trash can, among various other coincidences. Jerry dates a woman who is a former Olympic gymnast and ventures into the territory of sexual pleasures that most men dare not dream of. Elaine tries to pry Mr. Pitt away from looking at Kramer's new 3-D art poster. Meanwhile, Kramer gets a kidney stone.", 'http://www.fanaru.com/seinfeld/image/thumb/44302-seinfeld-the-gymnast-episode-screencap-6x6.jpg', 6, 6],['The Soup', "Kramer convinces Jerry to get a free Armani suit from hack comic Kenny Bania. But when Bania decides that he doesn't want anything except for dinner, Jerry has a hard time accepting the suit knowing that there is a far greater catch involved. Things get even worse when, during the dinner, Bania insists that soup doesn't count as a meal. Meanwhile, Elaine has a British friend stay with her for a week.", 'http://edgecast.metatube-files.buscafs.com/uploads/videos/image/image_20317_1.jpg', 6, 7],['The Mom and Pop Store', "George buys a convertible he thinks was once owned by Jon Voight. Kramer tries to save a small shoe-repair business. Elaine answers a radio quiz, enabling Mr. Pitt to participate in the Macy's Thanksgiving Day Parade. Meanwhile, Jerry tries to solve the mystery of whether or not he's invited to Tim Whatley's annual Pre-Thanksgiving party.", 'http://a.dilcdn.com/bl/wp-content/uploads/sites/8/2013/11/Screen-Shot-2013-11-17-at-9.19.25-PM.png', 6, 8],['The Secretary', 'George gets a secretary, saying he will go for efficiency and smarts rather than beauty. He hires a librarian-esque woman, only to find himself falling in love with her.', 'http://www.rawstory.com/rs/wp-content/uploads/2014/10/Senator-Bernie-Sanders-speaks-to-Bloomberg-Politics-Screenshot-800x430.jpg', 6, 9],['The Race', "When George notices that Elaine's new boyfriend reads the Daily Worker, he asks if he's a Communist. He says he is, which Elaine seems to wear as a badge of honor. Thanks to his friend Mickey, Kramer gets a job as a department store Santa. Things start out okay but veer off after he reads some literature from Elaine's boyfriend. George answers a personal ad in the Daily Worker and soon everyone in the Yankees front office thinks he's a Communist. Jerry meanwhile learns that his new girlfriend's boss is an old high school rival he once beat at a track meet and has ...", 'https://lh3.ggpht.com/B-c6HjM94T9DRqK9iu_nm1ehedV3ibsDkTSR_In5CsrwPlT7L1SDl6AoxT9q4QfBZg=h900', 6, 10],['The Switch', "Elaine loans Mr. Pitt's expensive tennis racket to an executive from Doubleday who hints there may be a job opening for Elaine soon. When the woman injures her arm, Elaine can't quite get the racket back. Jerry's girlfriend never smiles or laughs at his jokes but her roommate laughs at everything he says so he contemplates the switch. George comes up with an idea as to how he might get away with it. George's girlfriend, a model, eats like a horse but never puts on weight. Kramer suggests she might be bulimic. The gang learns Kramer's first name, thanks to his mom Babs.", 'http://3.bp.blogspot.com/_XmJC-ou7t6I/TS8tWyTO1QI/AAAAAAAAAZ8/UxnPFdOYzAs/s1600/seinfeld.jpg', 6, 11],['The Label Maker', 'Jerry gets Super Bowl tickets but cant use them because of obligations to attend a friend\'s wedding. He gives them to Tim Whatley and gets a label maker in return. Elaine is convinced that the label maker is the exact same one that she gave him a week before. Jerry then accuses Whatley of "re-gifting" the label maker. George, learns that his girlfriend has a male roommate and gets weirded out by the concept, but loves the male roommate\'s possessions which include a velvet couch. The couple learns that the wedding is on the same day as the Super Bowl and then calls the...', 'http://3.bp.blogspot.com/_fumLJexv-ps/TPctHsA_E4I/AAAAAAAAA-4/vqquy1ImRqY/s400/tumblr_la7adcqsDW1qe04gdo1_500.png', 6, 12],['The Scofflaw', 'Kramer is walking down a street and sees a man littering. He calls the guy a "pig" but doing so offends a cop who is standing a few feet away. Of course, the cop isn\'t paying attention and the scofflaw gets away. Kramer decides that he needs a new look and goes with an eye patch. George runs into Gary Fogel, a man who was having cancer and decided not to tell him. But he did tell Jerry, who reveals that he made himself nearly sick being nice to the guy. The next day, George meets with Gary, who drops a bombshell that he never actually had cancer and that the operation...', 'http://img3.wikia.nocookie.net/__cb20120913215950/seinfeld/images/d/da/The_scofflaw.jpg', 6, 13],['Highlights of a Hundred', "For the series' 100th episode, Jerry Seinfeld hosts a one hour retrospective with clips from previous episodes: the idea for a show about nothing; the smelly car; the puffy shirt; the astronaut pen; Jerry's hair; George's lack of hair; Mulva; Jerry's virgin girlfriend; the Hernandez incident; the outing; the masters of their domain; the bubble boy - are only a few of the episodes included.", 'http://www.fanaru.com/seinfeld/image/thumb/44312-seinfeld-the-beard-episode-screencap-6x16.jpg', 6, 14],['The Beard', 'Elaine attempts to convert a gay man to heterosexuality. Kramer sets George up with a woman, but forgets what she looks like. When they consult a police sketch artist, Jerry hooks up with a female officer, who then has Jerry take a polygraph test on whether or not he\'s seen the show "Melrose Place".', 'http://tawakachina.files.wordpress.com/2011/09/screen-shot-2011-09-27-at-11-56-18-am.png?w=922', 6, 15],['The Kiss Hello', "Kramer tries to create a Utopian society when he puts up pictures of all the residents of his and Jerry's building. Jerry doesn't mind until the women of the building want to be greeted with a kiss. After Jerry objects to kissing hello, he's vilified and nearly kicked out of the building. Jerry also has to settle some family issues when Nana remembers that Uncle Leo was supposed to give Morty some money 50 years ago and Uncle Leo puts Nana in a home to keep her quiet. Meanwhile, Elaine's friend who is a chiropractor skips out on George's appointment and goes skiing ...", 'https://lh3.googleusercontent.com/-7MnbMusrXiw/TwST2Bx68ZI/AAAAAAAAAdo/d8HIaaYcMnw/w800-h800/Screen%2Bshot%2B2012-01-04%2Bat%2B7.44.13%2BAM.png', 6, 16],['The Doorman', 'Elaine house-sits for Mr. Pitt. Jerry goes to meet up with her to go to the movies and winds up offending the Doorman. So to make up for it, Jerry watches the door. But when Jerry leaves his post and the couch in the lobby is stolen, Jerry and Elaine formulate a plan to cover their tracks. Meanwhile, Kramer invents a bra for men and George tries to find a way to get his father out of his apartment.', 'http://img4.wikia.nocookie.net/__cb20120914030833/seinfeld/images/9/96/The_doorman.jpg', 6, 17],['The Jimmy', "The gang has various encounters with a man named Jimmy, who talks about himself in the 3rd person. Elaine asks Jimmy to go to the benefit for the Able Mentally Challenged Adults organization starring Mel Torme. Thanks to Jimmy's shoes and getting too much Novocaine at Whatley's office, Kramer is mistaken for a mentally challenged man when he encounters the head of the AMCA. Jerry suspects Tim Whatley and his assistant are using patients for sexual pleasures when he finds pornographic magazines in Whatley's waiting room and thinks that he was violated while under the ...", 'http://media.salon.com/2014/02/Screen-Shot-2014-02-19-at-10.10.23-AM-620x374.png', 6, 18],['The Doodle', "George dates a girl from Elaine's art class and wonders whether or not her humorous caricature of him is a sign that she likes him or not. Thanks to Newman's fleas, Jerry's visiting parents are forced to stay in Elaine's luxury hotel room. Elaine gets a potential job offer but accidentally leaves the manuscript in Jerry's flea-infested apartment.", 'http://www.moviemistakes.com/images/mistakegrabs/37311.jpg', 6, 19],['The Fusilli Jerry', 'Kramer gets new license plates, but a DMV screw-up gives him a new vanity license plate - "ASS MAN". George\'s mom gets plastic surgery. Kramer makes pasta sculptures of his friends, and makes one out of Jerry using Fusilli pasta. Jerry tells Puddy about his "move", which he proceeds to use on Elaine. He also tells George, but George screws it up, and his girlfriend gets freaked out when he uses crib notes. Kramer finally tracks down the Ass Man when Frank falls on the Fusilli Jerry and they have to take him to a proctologist.', 'http://www.siyumhaseinfeld.com/images/eps/621.jpg', 6, 20],["The Diplomat's Club", "Jerry's new agent thinks he's a celebrity who needs his hand held on every little decision. After she tells him that the pilot who flew the plane to Ithaca is in the audience, Jerry freaks out. Kramer goes to the Diplomat's Club to meet up with Jerry and winds up gambling with a Texas business man on which plane is going to arrive first. Meanwhile, Mr. Pitt puts Elaine in his will, and Mr. Pitt's lawyer has reason to suspect that Elaine is up to something.", 'http://www.fanaru.com/seinfeld/image/thumb/44316-seinfeld-the-doodle-episode-screencap-6x20.jpg', 6, 21],['The Face Painter', 'Jerry scores premium tickets to a New Jersey Devils playoff game. He invites Kramer, Puddy, and Elaine along. But Jerry gets weirded out when Puddy shows up at the game and paints his face to match the team colors. Puddy gets so worked up after the game that he freaks out a visiting pastor from El Salvador, who is convinced that Puddy really is the devil. Elaine tries to convince him otherwise. Kramer enjoyed the game so much that he tries to convince Jerry to get more tickets from the guy Jerry got them from. Meanwhile, George decides to tell his girlfriend that he ...', 'http://1.bp.blogspot.com/-jvbDPvCybm4/T8EtzzD6msI/AAAAAAAAEU4/RqixZBPArvU/s640/the-devils-david-puddy.jpg', 6, 22],['The Understudy', "Jerry dates the ultra-sensitive understudy for Bette Midler in Rochelle, Rochelle: The Musical. When the Improv is scheduled to play Rochelle Rochelle in a softball game, George plows into catcher Bette Midler to score the winning run. Bette is injured because of the incident and is unable to perform in the Broadway premiere. Jerry, George, and the understudy are vilified for the incident, and Kramer goes out of his way to help Bette. Meanwhile, Elaine suspects that a local nail shop is making fun of her in Korean. She learns that George's dad Frank speaks Korean and ...", 'http://img2.wikia.nocookie.net/__cb20130818173034/seinfeld/images/b/b0/Gennice.jpg', 6, 23],['The Engagement', "While sitting in the coffee shop, Jerry and George resolve to grow up and take life more seriously. Jerry decides to call the woman he recently broke up with - because she shushed him. For his part, George has been thinking a lot about his former girlfriend Susan. After imagining the ideal life they could have together, he goes to her apartment and proposes. She accepts and George almost immediately begins to have second thoughts, especially after Jerry breaks up with his girlfriend a second time. Elaine meanwhile is having trouble with a neighbor's barking dog and ...", 'http://plasmapool.org/wp-content/uploads/2011/02/Screen-shot-2011-02-06-at-12.19.40-PM-1024x767.png', 7, 1],['The Postponement', 'Feeling overwhelmed, George wants to postpone marrying Susan.', 'http://cdn.images.express.co.uk/img/dynamic/79/590x/511590_1.jpg', 7, 2],['The Maestro', 'Elaine dates the conductor of an orchestra who insists everyone calls him "Maestro."', 'http://upload.wikimedia.org/wikipedia/en/6/67/Jackie_Chiles_in_The_Maestro_Seinfeld.JPG', 7, 3],['The Wink', "Jerry squirts grapefruit into George's eye at breakfast, and for the rest of the day George is misinterpreted because everyone thinks he is winking at them.", 'https://sexandstats.files.wordpress.com/2014/10/screen-shot-2014-10-12-at-10-14-16-pm.png', 7, 4],['The Hot Tub', 'Wilhelm thinks George is cracking under the pressure of working in the big leagues. So he has George entertain a group of visiting baseball officials from the Houston Astros, who are in New York to discuss inter-league play. George picks up a bad habit from them, who call everyone either a "bastard" or a "son of a bitch". Kramer buys a hot tub from his friend Lomez and installs it in his apartment. At the same time, Elaine is having a marathon runner from Trinidad And Tobago named Jean Paul Jean Paul stay with her as a house guest. Jean Paul was in the Olympics and ...', 'http://www.fanaru.com/seinfeld/image/thumb/44325-seinfeld-the-hot-tub-episode-screencap-7x5.jpg', 7, 5],['The Soup Nazi', "A soup stand owner obsesses about his customers' ordering procedure, but his soup is so good that people line up down the block for it anyway.", 'http://www.youngcons.com/wp-content/uploads/2014/02/soupnazi.jpg', 7, 6],['The Secret Code', "George refuses to give anyone his secret code (BOSCO). Kramer buys a police scanner. Jerry does a series of ads for Leapin' Larry's Appliance Store. Elaine has dinner with J. Peterman but after she and Jerry bail on the dinner, George is stuck to dine with Peterman. George spills his secret code to Peterman's dying mother and gets in trouble for it.", 'https://s3.amazonaws.com/cdn01.mishkanyc.com/sites/default/files/uploads/2012/04/Screen-Shot-2012-04-19-at-4.41.31-PM.png', 7, 7],['The Pool Guy', "Jerry has a hard time telling the pool guy at his new health club that there isn't room for a 5th member of the group. George's worlds collide when Elaine starts hanging out with Susan. Kramer discovers that his phone number is one digit off from that of a popular movie-finding service and offers help to those that mistakenly call his number.", 'http://www.fanaru.com/seinfeld/image/44328-seinfeld-the-pool-guy-episode-screencap-7x8.jpg', 7, 8],['The Sponge', 'After learning that her prophylactic of choice is being discontinued, Elaine buys a case of Today sponges and scrutinizes her dates for their sponge-worthiness.', 'http://www.fanaru.com/seinfeld/image/44329-seinfeld-the-sponge-episode-screencap-7x9.jpg', 7, 9],['The Gum', "Lloyd Braun comes back from the insane asylum. Kramer takes him under his wing and convinces Jerry to buy gum from him and wear glasses that don't belong to him to prove that Lloyd isn't crazy. George tries to prove to his old neighbor Deena that he isn't crazy after a cashier short changes him.", 'http://plasmapool.org/wp-content/uploads/2011/02/Screen-shot-2011-02-05-at-5.55.45-PM-221x300.png', 7, 10],['The Rye', "After George's parents take back the bread they gifted to Susan's parents, George makes Jerry find another loaf and tries to appease Susan's parents by taking them on Kramer's Manhattan horse tours, to disastrous consequences.", 'http://www.arsjerm.net/seinfeld-marble_rye.jpg', 7, 11],['The Caddy', "Elaine's floozy former ex-roommate Sue Ellen Mischkie returns. George locks his keys in his car and leaves it in the Yankees parking lot. Elaine, out of spite, buys Sue Ellen a bra for a birthday gift as she has never worn one. George, having successfully convinced Wilhelm and Steinbrenner that he's putting in extra hours, decides to skip town with Susan after learning that her father rebuilt the cabin. So George asks Kramer and Jerry to go to Yankee Stadium and take the fliers off of his car. The car is really dirty, and Jerry and Kramer decide to go take it to the ...", 'http://www.fanaru.com/seinfeld/image/thumb/44332-seinfeld-the-caddy-episode-screencap-7x12.jpg', 7, 12],['The Seven', "George meets Susan's cousins. The wife is expecting a baby and they are having a hard time agreeing on the name. George reveals that he wants to name his kid Seven after Mickey Mantle. The cousins like the idea of naming their kid Seven, but nobody else does. Elaine buys an antique bicycle and hurts her neck in the process. Kramer fixes her neck and wants the bicycle in exchange for payment. Jerry's new girlfriend wears the same dress every single day.", 'http://images.smh.com.au/2014/11/07/5963047/Article%20Lead%20-%20wide6300532111ifj2image.related.articleLeadwide.729x410.11if7t.png1415319013844.jpg-620x349.jpg', 7, 13],['The Cadillac', 'In this hour-long episode, Jerry performs the biggest show of his life in Atlantic City. He receives a rather generous pay check for the event, and decides to buy his father a Cadillac. Unfortunately, doing so puts Morty in the hot seat with the condo board of directors, where he serves as president. Morty is accused of stealing money from the board, and ultimately gets removed from his post as president and kicked out of the condo. Meanwhile, thanks to Elaine, George can score a date with "My Cousin Vinnie" star Marisa Tomei but Elaine objects because of George\'s ...', 'http://www.fanaru.com/seinfeld/image/thumb/44334-seinfeld-the-cadillac-1-episode-screencap-7x14.jpg', 7, 14],['The Shower Head', 'Peterman wants Elaine to go to Africa, but when Elaine tests positive for Opium in her physical, that means no dice. George tries to convince his parents to move to Florida so that he finally gets his "buffer zone", but they have problems with Jerry\'s parents. Kramer and Newman scheme to buy black market shower heads when the building switches to low-flow ones.', 'http://www.criticalcommons.org/Members/Ghent/clips/the%20shower%20head.mp4/thumbnailImage', 7, 15],['The Doll', 'George freaks out when he discovers that Susan has a doll that looks exactly like his mother. Jerry decides to use that as a bit on the Charles Grodin show when his prop gets destroyed in his carry-on luggage, but fellow comedian Sally Weaver screws up his bit by bringing him the wrong doll.', 'http://mentalfloss.com/sites/default/files/styles/article_640x430/public/screen_shot_2013-02-08_at_2.49.33_pm.png', 7, 16],['The Friars Club', "Jerry has a hard time getting membership in the Friar's Club when the Flying Santos Brothers take his jacket during a show. Meanwhile, Elaine suspects that a new co-worker (Rob Schnieder) is faking a hearing disorder to get out of doing work.", 'http://www.fanaru.com/seinfeld/image/thumb/44338-seinfeld-the-friars-club-episode-screencap-7x18.jpg', 7, 17],['The Wig Master', "Susan's friends are in town for the Broadway production of Joseph And The Amazing Technicolor Dreamcoat. Kramer gets to wear the coat and is mistaken for a pimp in public when he accuses a local parking lot of running a prostitution ring out of his car. Jerry buys a jacket and later returns it for spite. Elaine tries to buy a dress from the same guy Jerry gets the jacket from, but is stunned to learn that he's holding it until Elaine sleeps with him.", 'http://img0.worldhistoryproject.org/photos/images/91fef8a2e04cf29561c675a068beee83_three_column.jpg', 7, 18],['The Calzone', "George gets Steinbrenner hooked on eggplant calzones from a local Italian restaurant. But George gets banned from the restaurant when he's accused of stealing from the tip jar. He then asks Kramer to pick up the calzones, but Kramer gets kicked out when he tries to pay with pennies. George's last resort in getting the calzones is Newman who wants a cut of every delivery. Meanwhile, Kramer will only wear clothing if it's straight from the dryer.", 'http://www.fanaru.com/seinfeld/image/thumb/44340-seinfeld-the-calzone-episode-screencap-7x20.jpg', 7, 19],['The Bottle Deposit', "In this two-part episode, Kramer and Newman scheme to make money on recycling by taking a mail truck to Michigan full of bottles and cans. But their road trip takes a turn for the worst (literally) when Jerry's car is stolen by a psychotic auto mechanic and they track Jerry's car out in the Midwest. Elaine outbids Sue Ellen Mischkie by double her budget for JFK's golf clubs and leaves them in Jerry's car. George gets a project from his boss Wilhelm but doesn't hear the other end of what he's supposed to do. Steinbrenner sees the results of George's project and has him...", 'http://img2.wikia.nocookie.net/__cb20120506034303/seinfeld/images/c/cc/The_Bottle_Deposit.jpg', 7, 20],['The Wait Out', 'George makes a comment that breaks up a married couple. Because of this comment, he tries to find a way out of his pending marriage to Susan by any means necessary. Jerry and Elaine swoop in to pick up the pieces of said relationship. Kramer wears an unusually tight pair of jeans and cant take them off.', 'http://www.fanaru.com/seinfeld/image/thumb/44343-seinfeld-the-wait-out-episode-screencap-7x23.jpg', 7, 21],['The Invitations', 'It\'s finally time for George and Susan\'s wedding. George doesn\'t think he can go through with the wedding. But when Susan puts George in charge of the wedding invitations, George gets the cheapest ones in the lot, knowing that the glue for the envelopes is cheap. Unfortunately for Susan, the glue is also toxic and licking the envelopes has fatal consequences. Meanwhile, Jerry courts a woman just like him named Janeanne Steinberg and holds up his end of George\'s "pact" (see episode "The Engagement").', 'http://www.fanaru.com/seinfeld/image/44344-seinfeld-the-invitations-episode-screencap-7x24.jpg', 7, 22],['The Foundation', 'After Susan dies, George decides to live the high life by going the bachelor pad route. But his fun quickly ends when Jerry quotes Star Trek II and the Ross\'s decide to create a foundation in Susan\'s memory. Jerry gets reacquainted with Mulva (see episode "The Junior Mint") and decides to do some research into which recent break-up story was more believable - his or George\'s. Elaine gets in trouble when J. Peterman flees to Burma and puts her in charge of the catalog. She doesn\'t think she is up to the task of running a large business until Kramer motivates her with ...', 'http://local-static4.forum-files.fobby.net/forum_attachments/0028/6289/virtual_boy_in_seinfeld.bmp', 8, 1],['The Soul Mate', "George is convinced that the chairman of the Susan Biddle Foundation thinks he killed Susan. He tries to record their conversation when he's not there but doesn't quite get it right. Elaine meets some old friends all of whom now have babies. She of course does not want children and that leads her to a like-minded new boyfriend, Kevin. Jerry's new girlfriend Pam drops in on Jerry but it's Kramer who is smitten. The more Kramer says he likes her however, the more Jerry does as well.", 'http://www.fanaru.com/seinfeld/image/44346-seinfeld-the-soul-mate-episode-screencap-8x2.jpg', 8, 2],['The Bizarro Jerry', "Elaine meets Kevin's friends and feels likes she's entered the world of Bizarro Jerry where her world is in reverse. Jerry has a date with Gillian, a woman with man hands. George hits on a new sob story to try and get in with a beautiful receptionist. Kramer gets an unpaid job at a upscale firm.", 'http://cdn3.whatculture.com/wp-content/uploads/2013/12/Bizarro.jpg', 8, 3],['The Little Kicks', 'Kramer\'s friend Brody forces Jerry to bootleg the movie "Death Blow". George follows Elaine to her office party and finds out that she has a "unique" dancing style. She starts to get a weird vibe from her subordinates and blames it all on George. George becomes the bad boy and wins the affection of Elaine\'s employee Anna. Jerry finds out that he is a gifted bootlegger and demands perfection while shooting "Cry, Cry, again". Kramer tells Elaine she can\'t dance. She then videotapes herself dancing over the bootleg of "Cry, Cry, Again". Elaine apologizes over the phone ...', 'http://www.fanaru.com/seinfeld/image/44348-seinfeld-the-little-kicks-episode-screencap-8x4.jpg', 8, 4],['The Package', 'Kramer tries to get a "refund" for Jerry\'s broken stereo. Jerry is against the idea until he gets a mysterious package in the mail. Newman accuses Jerry of mail fraud when Uncle Leo signs for the package and an explosion is heard while he is talking to Jerry. George, meanwhile, gets involved with "Photo Store Shelia" when she accidentally slips an enticing photo in George\'s pictures. George decides to send one back, but the plan backfires. And Elaine gets a rash and is barred from every doctor in New York when she takes a peek at her medical chart.', 'http://cdn8.staztic.com/app/a/2028/2028336/seinfeld-free-live-wallpaper-925274-2-s-307x512.jpg', 8, 5],['The Fatigues', "Kramer volunteers to set up a Jewish singles mixer. He has a hard time finding a cook for the event until he learns that Frank was a cook in the Korean War. But Frank refuses to cook for the event because he experienced a severe case of shell shock. Meanwhile, Elaine tries to get rid of an unruly employee in Peterman's mailing room but winds up promoting the guy instead. Jerry dates a woman with a mentor, but he gets weirded out when he finds out that the mentor is dating hack comic Kenny Bania. Jerry, inspired by this, decides to take Bania under his wing and mentor ...", 'http://3.bp.blogspot.com/-CkmPZNYKwMc/UZV3BIChtKI/AAAAAAAACuM/8ZV0v4xFXh0/s1600/Screen+shot+2013-05-04+at+7.39.09+AM.png', 8, 6],['The Checks', "Jerry gets hundreds of royalty checks, worth 12 cents each, for appearing on a Japanese TV program and gets writer's cramp. George and Jerry pitch their pilot to Japanese TV executives.", 'https://lh3.ggpht.com/B-c6HjM94T9DRqK9iu_nm1ehedV3ibsDkTSR_In5CsrwPlT7L1SDl6AoxT9q4QfBZg=h900', 8, 7],['The Chicken Roaster', "Kenny Rogers' Roasters sets up shop across the street from Jerry and Kramer's apartment. Unfortunately, their unusually large chicken sign causes problems for everybody. Kramer and Jerry wind up switching apartments because of it - and personalities. Jerry is freaked out by a wooden doll in Kramer's apartment and Newman gets Kramer hooked on Kenny Roger's chicken. Elaine gets comfortable in her position as president of the catalog but is quickly accused of abusing her company credit card benefits. Especially when Elaine buys George an expensive hat and George ...", 'http://img2.wikia.nocookie.net/__cb20101004134329/seinfeld/images/5/54/Seinfeld_kenny_rogers_roasters.jpg', 8, 8],['The Abstinence', 'Abstinence allows George to become a genius, but it turns Elaine into an idiot. Jerry gets bumped from career day at his old Jr. High School. Kramer turns his apartment into a smoking lounge and all the smoke disfigures his face.', 'http://www.fanaru.com/seinfeld/image/thumb/44353-seinfeld-the-abstinence-episode-screencap-8x9.jpg', 8, 9],['The Andrea Doria', 'A survivor of a shipwreck beats George out of an apartment, so George decides to tell the landlords the tragedies of his life in hopes of getting it back based on pity.', 'http://i.ytimg.com/vi/nyWCNm16pu0/maxresdefault.jpg', 8, 10],['The Little Jerry', "Kramer gets a pet rooster that he names after Jerry. Jerry bounces a check at the local liquor store but has difficulty paying it off. So much in fact, that his parents think that Jerry is strapped for cash. Marcelino, the owner of the liquor store, tells Jerry that there is money to be made in underground cockfighting rings. When Little Jerry wins his first fight, Marcelino wants to buy the bird, but Jerry and Kramer refuse to sell. Meanwhile, as part of his duties with the Foundation, George goes to a women's prison where they have just donated a generous sum of ...", 'http://static.iphonelife.com/sites/iphonelife.com/files/u28861/Screen%20Shot%202012-08-29%20at%203.06.20%20PM.png', 8, 11],['The Money', 'Jerry buys his parents a Cadillac. His parents sell it to Jack Clompus for 6000 dollars and try and give the money to Jerry. Elaine has stock options at Peterman\'s and buys George coffee. George feels that she is "sticking" it to him. George tries to convince his parents to stay in Queens because he wants their money. They then decide to buy expensive things and move to Florida. Kramer\'s girlfriend has the "jimmy legs" and they sleep in the Costanza\'s apartment when they go to Florida. Jerry buys back the Cadillac from Clompus for 14000 dollars. Clompus crashes it ...', 'https://lh3.ggpht.com/B-c6HjM94T9DRqK9iu_nm1ehedV3ibsDkTSR_In5CsrwPlT7L1SDl6AoxT9q4QfBZg=h900', 8, 12],['The Comeback', 'George gets insulted by a co-worker named Reilly during a business meeting with the line "Hey George, the ocean called and they\'re running out of shrimp". He plans to get back at him with the "jerk store" remark, which all his friends try to change. Jerry buys a new tennis racket from Milos, a tennis pro-shop worker, because he thinks he is a great tennis player. Jerry finds out that Milos is a terrible tennis player and Milos offers Jerry his wife, Patty as some sort of "medieval sexual payola". Patty loses respect for Milos and begs Jerry to let him win a game of ...', 'http://uwire.com/wp-content/uploads/2012/10/Screen-shot-2012-10-05-at-9.16.04-AM.png', 8, 13],['The Van Buren Boys', 'Kramer gets mixed up with a gang when he is mugged by them and mistakenly shows their secret sign.', 'http://www.fanaru.com/seinfeld/image/thumb/44358-seinfeld-the-van-buren-boys-episode-screencap-8x14.jpg', 8, 14],['The Susie', 'A co-worker of Elaine\'s thinks Elaine is called Susie, and Elaine doesn\'t bother to correct her, when she badmouths Elaine to "Susie." Elaine complains of this to Jerry, who commiserates with her. Later, Peggy gets "Susie" called in front of Peterman, who demands that Elaine be there also. Elaine finds a way to wriggle out of the situation so that neither realizes Susie doesn\'t exist. Meanwhile, Kramer puts 100 dollars on a basketball game in Jerry\'s name with Mike, the guy Jerry called a phony in "The Parking Space." When Kramer attends the game, he gets in a fight ...', 'http://www.fanaru.com/seinfeld/image/thumb/44359-seinfeld-the-susie-episode-screencap-8x15.jpg', 8, 15],['The Pothole', "Jerry accidentally knocks his girlfriends toothbrush into her toilet. He refuses to tell her and won't kiss her. Kramer adopts a section of highway and tries to improve it. Elaine tries to get chinese food delivered by using a janitors closet in a different building. George drops his Phil Rizutto key chain in a pothole, which gets filled and he tries to dig it out.", 'http://www.fanaru.com/seinfeld/image/44360-seinfeld-the-pothole-episode-screencap-8x16.jpg', 8, 16],['The English Patient', 'Elaine is dragged to see the movie "The English Patient" on multiple occasions, even though she absolutely hates the film.', 'http://www.fanaru.com/seinfeld/image/44361-seinfeld-the-english-patient-episode-screencap-8x17.jpg', 8, 17],['The Nap', "George needs to find a way to have a nap at work. His glass wall doesn't seem to make that possible but he finds a way anyways. He runs into a bit of trouble when Mr. Steinbrenner wants to see him and decides to wait in George's office. Elaine has a problem with her new boyfriend Hal who has a new mattress delivered to house. Kramer has taken up swimming but finds the pool crowded. He finds a new place that gives him lots of room - the East River. Jerry is losing his patience with the man he's hired to install new kitchen cabinets.", 'http://www.southdacola.com/blog/wp-content/uploads/2010/07/0.jpg', 8, 18],['The Yada Yada', "George's new girlfriend often fills in her stories with the expression yada-yada leaving out much of the detail. Jerry tells him she's being concise but not knowing what's going starts to drive George crazy. Jerry meanwhile is convinced that his dentist, Tim Whatley, has converted to Judaism to he can tell Jewish jokes. When he continues to tell Catholic jokes, he even complains to Whatley's former priest. It all leads Kramer to accuse him of being an anti-Dentite. Elaine is asked by friends to be a character reference with a adoption agency but she doesn't exactly ...", 'http://mentalfloss.com/sites/default/files/styles/insert_main_wide_image/public/screen_shot_2014-07-03_at_10.36.48_am.png', 8, 19],['The Millennium', 'Kramer and Newman compete during the early planning of each of their millenium parties.', 'http://www.fanaru.com/seinfeld/image/thumb/44364-seinfeld-the-millennium-episode-screencap-8x20.jpg', 8, 20],['The Muffin Tops', 'Elaine opens a new bakery that sells only the tops of the muffins.', 'http://content7.flixster.com/question/62/66/74/6266741_std.jpg', 8, 21],['The Summer of George', "With three months' severance pay from the Yankees, George decides that he's going to have a great summer. Things don't quite go as planned. Jerry meanwhile is dating someone new, Lanette, who he invites to attend the Tony awards with him. When he picks her up, however, she seems to already have a live-in boyfriend. Kramer is also at the awards ceremony and gets dragged on stage with some of the winners. He basks in the glow of having 'won' a Tony and the producers decide to use him to get rid of their star, Raquel Welch. At her work, Elaine makes a comment about a ...", 'http://twistedsifter.files.wordpress.com/2012/04/summer-of-george-seinfeld.jpg', 8, 22],['The Butter Shave', 'Kramer discovers the amazing yet unknown uses of butter, but accidentally fries himself after using it as sunscreen.', 'http://www.fanaru.com/seinfeld/image/thumb/44367-seinfeld-the-butter-shave-episode-screencap-9x1.jpg', 9, 1],['The Voice', "Kramer sets up a new company - Kramerica Industries, and hires an intern from NYU to help out with the day to day activities of running a fake large company. Jerry thinks his girlfriend's navel is talking to him. George continues to work for Play Now even though his boss is trying to force him out after George lied about being handicapped. Elaine makes wagers with Jerry that she will not continue to see David Puddy.", 'https://lh3.ggpht.com/B-c6HjM94T9DRqK9iu_nm1ehedV3ibsDkTSR_In5CsrwPlT7L1SDl6AoxT9q4QfBZg=h900', 9, 2],['The Serenity Now', 'Frank sets up a new business selling computers and hires George and Lloyd Braun (seen in "The Non Fat Yogurt" and "The Gum") to compete against each other in a sales contest. But Frank\'s relaxation technique drives everybody completely nuts. Jerry\'s new girlfriend encourages him to let his emotions out. Kramer takes Frank\'s screen door and puts it up in his apartment, creating "Anytown, USA", but the local kids make relaxation difficult. Elaine discovers her "shiksa appeal" and suddenly every Jewish man in New York, including her former boss, is attracted to her.', 'http://www.fanaru.com/seinfeld/image/thumb/44369-seinfeld-the-serenity-now-episode-screencap-9x3.jpg', 9, 3],['The Blood', "Jerry's parents hire their friend Izzy Mandelbaum to become Jerry's personal trainer while George decides to associate food and television with his love life.", 'http://www.marketplace.org/sites/default/files/styles/primary-image-766x447/public/Kramer%20moviefone.jpg?itok=j2KJd3Dh', 9, 4],['The Junk Mail', 'Kramer becomes annoyed at all the junk mail he gets, so he decides to stage a crusade against the post office. Jerry runs into "Fragile Frankie", a former childhood acquaintance, who tries to sell Jerry a huge new van. Frank and Estelle try to find a way to spice up their love life, against George\'s objections. Meanwhile, Elaine dumps Puddy for a guy who does TV spots for an electronics store called "Nobody Beats The Wiz".', 'http://www.fanaru.com/seinfeld/image/thumb/44371-seinfeld-the-junk-mail-episode-screencap-9x5.jpg', 9, 5],['The Merv Griffin Show', "After Kramer rescues the set of the old Merv Griffin show from a dumpster, he sets it up in his apartment where he interviews anyone who happened to drop by. George's new girlfriend gives him a hard time after he strikes a pigeon with his car. When he hits a squirrel she insists that he take it to the vet and then care for it at home. A new guy at the office is driving Elaine crazy. Jerry has a new girlfriend who inherited a fabulous collection of classic toys from her late father. She won't let Jerry touch them - let alone play with them - but he soon finds a way ...", 'http://www.fanaru.com/seinfeld/image/thumb/44372-seinfeld-the-merv-griffin-show-episode-screencap-9x6.jpg', 9, 6],['The Slicer', "Elaine borrows Kramer's meat slicer to feed her neighbor's cat while George tries to hide his not-so-great past from his new boss.", 'http://thoughtcatalog.files.wordpress.com/2013/10/screen-shot-2013-10-18-at-9-02-34-pm.png?w=584&h=578', 9, 7],['The Betrayal', 'The famous "backwards episode". Elaine decides to spite her old college roommate Sue Ellen Mischkie by taking her, Jerry and George to India to attend Sue Ellen\'s wedding. Elaine repeatedly reveals secrets about her past when Jerry discovers the combination to Elaine\'s "vault". Jerry runs in to an ex-flame - Nina, who is a "great conversationalist". George wears boots that alter his height to impress Nina and doesn\'t use the bathroom the entire time they are in India. Meanwhile, Kramer has a nasty encounter with a man named Franklin Delano Romanowski who tells him to ...', 'http://insuranceentertainment.com/wp-content/uploads/2014/07/Screen-Shot-2014-07-06-at-10.13.01-AM.png', 9, 8],['The Apology', "George goes out of his way to seek an apology for an insult. Elaine is insulted when a fellow co-worker is scared of her germs, while Puddy admits that he's a fellow germophobe. Jerry dates a nudist and learns the difference between good naked and bad naked. Kramer installs a garbage disposal in his shower.", 'http://nilrr.org/wp-content/uploads/2013/04/Seinfeld_61.jpg', 9, 9],['The Strike', 'Kramer returns to H&H bagels after a 12 year strike. Elaine gives "denim vest" a fake number on her free sub card. Jerry meets a woman named Gwen who is "two faced". (She doesn\'t look good in some light)George creates a fake charity called "the human fund" to give fake Christmas presents at Kruger. He invites Kruger over to celebrate "Festivus" when he can\'t cash the 20,000 dollar charity check to "the human fund".', 'http://www.gannett-cdn.com/-mm-/e275fd53994e79074941b586fb8d8f70c3ac72bd/c=14-0-605-444&r=x404&c=534x401/local/-/media/USATODAY/test/2013/12/18//1387386012000-festivus.jpg', 9, 10],['The Dealership', "Jerry goes to buy a new car from David Puddy, who's been promoted to the sales floor. But after Elaine breaks up with Puddy (again), Jerry is worried that he wont get a good deal on the car. George seeks revenge on a mechanic after he accuses the mechanic of stealing his candy bar. Kramer takes the same car Jerry is looking at out on a long test drive to see how far he can go on free gas without filling up the tank.", 'http://rennlist.com/forums/attachments/944-turbo-and-turbo-s-forum/380337d1250961805-seinfeld-episode-167-the-dealership-2.jpg', 9, 11],['The Reverse Peephole', "Jerry, George, Elaine, and Putty get invited to Joe Mayo's party. Elaine throws Putty's fur out the his window. Kramer and Newman put reverse peepholes so they can see if anyone is in their apartment before entering. The super tries to evict Newman but Kramer sticks up for him. Newman begins a secret love affair with the super's wife and Kramer gets worried. Newman finds Putty's fur in a tree and George winds up paying for a massage chair because his back is tweaked from his fat wallet. Jerry carries a purse and wears a fur to fool the super and gets robbed on the ...", 'http://www.fanaru.com/seinfeld/image/thumb/44378-seinfeld-the-reverse-peephole-episode-screencap-9x12.jpg', 9, 12],['The Cartoon', 'Elaine accidentally steals a "Ziggy" cartoon and sends it to the New Yorker as one of her own. Jerry confides in Kramer that a fellow comedian, Sally Weaver, should quit stand up. Kramer tells her this and she then targets Jerry as the devil in her act. She gains popularity and gets her own cable special. George is dating a woman who looks like Jerry.', 'http://cdn.inquisitr.com/wp-content/uploads/2012/07/seinfeld-new-yorker-cartoon-screenshot-e1342708805848.png', 9, 13],['The Strongbox', "Kramer buys a strong box because there have been several robberies in the building. He tries to hide the key but Jerry keeps finding it. George is trying to break up with his girlfriend Maura, but can't convince her to leave. Jerry doesn't recognize his new neighbor, Phil, and won't let him in the building. Elaine is dating a poor man who she thinks is a super hero.", 'http://www.fanaru.com/seinfeld/image/thumb/44380-seinfeld-the-strongbox-episode-screencap-9x14.jpg', 9, 14],['The Wizard', "Kramer learns that he's finally making some royalties from his coffee table book. He decides to retire to Florida and live in the same condo complex as Jerry's parents. Jerry goes to visit his parents in Florida and gives his dad his birthday present - a Wizard portable computer. Morty thinks it only has one primary use - as a tip calculator. Kramer decides to run for the condo board of directors and Morty decides to use Kramer to install a puppet regime and wield power from behind the scenes. Jerry decides that in order for Kramer to win they need to get tip ...", 'http://www.fanaru.com/seinfeld/image/thumb/44382-seinfeld-the-burning-episode-screencap-9x16.jpg', 9, 15],['The Burning', 'Jerry is stunned to learn that his new girlfriend has a mysterious "tractor story" that she is not telling him. Kramer and Mickey act out symptoms for medical school students, but Kramer gets repeatedly typecast. George perfects the showmanship art of going out on a high note during meetings at Kruger. Meanwhile, Elaine is stunned to learn that Puddy is religious, and he informs her that she\'s going to hell.', 'http://4.bp.blogspot.com/-UPhRSfKp6Y4/T343mDuMNCI/AAAAAAAABJI/khrOnCPtT9c/s1600/Seinfeld+VHS.jpg', 9, 16],['The Bookstore', "While at Brentano's, George is forced to buy an expensive art book after taking it into the bathroom. George has a hard time getting rid of said book. Jerry catches Uncle Leo shoplifting and has a hard time dealing with the situation. Kramer and Newman set up a rickshaw business using New York's homeless population but the plans quickly backfire. Elaine gets in trouble when she has a drunken make out session at Peterman's Christmas party and Peterman orders the guy to attend rehab.", 'https://lh6.googleusercontent.com/-iTq9KNupM-I/T6wIZNT14jI/AAAAAAAABo4/9UENjbenD8w/w800-h800/Screen%2Bshot%2B2012-05-10%2Bat%2B8.25.49%2BAM.png', 9, 17],['The Frogger', "George tries to acquire an old Frogger machine on which he's held the top score since high school.", 'http://www.tepg.se/wp-content/themes/tepg/titles/[Series]Seinfeld%209x18%20The%20Frogger_03.jpg', 9, 18],['The Maid', 'Jerry winds up dating the maid he hired, and she starts to slack off on her duties.', 'http://wac.9ebf.edgecastcdn.net/809EBF/ec-origin.nyc.barstoolsports.com/files/2013/04/Screen-Shot-2013-04-30-at-3.03.23-PM.png', 9, 19],['The Puerto Rican Day', 'Jerry, George, Kramer and Elaine get stuck in standstill traffic due to the massive Puerto Rican Day Parade.', 'http://mybloggableday.files.wordpress.com/2011/09/screen-shot-2011-09-25-at-7-38-46-pm.png', 9, 20],['The Chronicle', 'Just as the four are about to go to the movies, Jerry looks back on the past nine years with the audience.', 'http://3.bp.blogspot.com/-8vOQQE-CgDs/UTgLqwKErLI/AAAAAAAABzg/0UNm8ieg9PE/s1600/Screen+shot+2013-03-06+at+9.04.41+PM.png', 9, 21],['The Finale', "After George and Jerry land a production deal with NBC, the four head out for Paris on NBC's private plane and are waylaid in a small Massachusetts town.", 'http://uproxx.files.wordpress.com/2013/12/screen-shot-2013-12-06-at-10-21-09-am.png?w=650', 9, 22]]